扫描方法为QNBleApi.startBleDeviceDiscovery，扫描到的设备数据，会在上面设置的扫描接口中QNBleDeviceDiscoveryListener回调。
另外有关扫描的一些特性设置，可以在QNConfig进行设置，这些选项应该足够使用。

通常APP会有个专门用于测量的界面，我们一般是在界面显示之后进行蓝牙扫描，界面消失的时候停止扫描。

