QNBleApi.getInstance(context).startBleDeviceDiscovery(new QNResultCallback() {
            @Override
            public void onResult(int code, String msg) {
                //该方法并不回到设备，而是表示扫描是否启动成功
                if (code != CheckStatus.OK.getCode()) {
